using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using System.Xml.Linq;
using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc;
using TexodeApp.Server.Models;

namespace TexodeApp.Server.Controllers
{
    //[Produces("application/json")]
    [Route("api/[controller]")]
    public class DataController : Controller
    {
        const string fileName       = "base.xml";
        const string rootElement    = "Books";
        const string baseElement    = nameof(Book);
        const string idAttribute    = nameof(Book.Id);
        const string nameElement    = nameof(Book.Name);
        const string imageElement   = nameof(Book.Base64Image);

        public DataController() {
            XDocument xdoc;

            if (System.IO.File.Exists(fileName)) {
                xdoc = XDocument.Load(fileName);

                xdoc.Root.Name = rootElement;
                xdoc.Descendants(baseElement)
                    .Where(x => 
                            x.Name != baseElement ||
                            x.Attribute(idAttribute) == null ||
                            !int.TryParse(x.Attribute(idAttribute).Value, out int i) || 
                            x.Element(nameElement) == null ||
                            x.Element(imageElement) == null
                        )
                    .Remove();
            }
            else
                xdoc = CreateXDocument();

            xdoc.Save(fileName);
        }

        // GET: api/Data
        [HttpGet]
        public IEnumerable<Book> Get() {
            var xdoc = XDocument.Load(fileName);

            return xdoc.Descendants(baseElement).Select(x => new Book {
                Id = int.Parse(x.Attribute(idAttribute).Value),
                Name = x.Element(nameElement).Value,
                Base64Image = x.Element(imageElement).Value
            });
        }

        // GET: api/Data/5
        [HttpGet("{id}")]
        public IActionResult Get(int id) {
            var xdoc = XDocument.Load(fileName);
            var xdocUser = GetBaseElementById(xdoc, id);

            if (xdocUser == null)
                return NotFound();

            return new ObjectResult(new Book {
                Id = id,
                Name = xdocUser.Element(nameElement).Value,
                Base64Image = xdocUser.Element(imageElement).Value
            });
        }
        
        // POST: api/Data
        [HttpPost]
        public IActionResult Post([FromBody]Book book) {
            if (book == null)
                return BadRequest();

            var xdoc = XDocument.Load(fileName);
            var maxId = xdoc.Descendants(baseElement).Any() ? 
                xdoc.Descendants(baseElement).Max(x => int.Parse(x.Attribute(idAttribute).Value)) : 0;

            xdoc.Root.Add(new XElement(baseElement,
                    new XAttribute(idAttribute, ++maxId),
                    new XElement(nameElement, book.Name),
                    new XElement(imageElement, book.Base64Image)
                ));

            xdoc.Save(fileName);

            book.Id = maxId;
            return Ok(book);
        }
        
        // PUT: api/Data/5
        [HttpPut]
        public IActionResult Put([FromBody]Book book) {
            if (book == null)
                return BadRequest();

            var xdoc = XDocument.Load(fileName);
            var xdocUser = GetBaseElementById(xdoc, book.Id);

            if (xdocUser == null)
                return NotFound();

            xdocUser.SetElementValue(nameElement, book.Name);
            xdocUser.SetElementValue(imageElement, book.Base64Image);

            xdoc.Save(fileName);

            return Ok(book);
        }
        
        // DELETE: api/Data/5
        [HttpDelete("{id}")]
        public IActionResult Delete(int id)
        {
            var xdoc = XDocument.Load(fileName);
            var xdocUser = GetBaseElementById(xdoc, id);

            if (xdocUser == null)
                return NotFound();

            xdocUser.Remove();
            xdoc.Save(fileName);

            return Ok(new Book {
                Id = id,
                Name = xdocUser.Element(nameElement).Value,
                Base64Image = xdocUser.Element(imageElement).Value
            });
        }

        [HttpDelete]
        public IActionResult DeleteMany([FromBody]IEnumerable<int> ids)
        {
            var xdoc = XDocument.Load(fileName);
            var xdocUser = GetBaseElementsByIds(xdoc, ids);

            if (xdocUser == null)
                return NotFound();

            xdocUser.Remove();
            xdoc.Save(fileName);

            return Ok();
        }

        XDocument CreateXDocument() {
            var userId = 1;
            return new XDocument(
                        new XElement(rootElement,
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "Lost to you"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "Irresistible"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "The Chosen"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "The Case of the Missing Bubble Gum Card"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "James Locker: The Duality of Fate"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "The Divine Sedition"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "Drive"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "Urban Mythic"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "A bad coin always turns up"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "The Forgotten Fifteenth"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "The Witch and the Warlock"),
                                new XElement(imageElement, "")
                            ),
                            new XElement(baseElement,
                                new XAttribute(idAttribute, userId++),
                                new XElement(nameElement, "Clone City"),
                                new XElement(imageElement, "")
                            )
                        )
                    );
        }

        XElement GetBaseElementById(XDocument xdoc, int id) {
            return xdoc.Descendants(baseElement).FirstOrDefault(x => int.Parse(x.Attribute(idAttribute).Value) == id);
        }

        IEnumerable<XElement> GetBaseElementsByIds(XDocument xdoc, IEnumerable<int> ids) {
            //return xdoc.Descendants(baseElement).FirstOrDefault(x => int.Parse(x.Attribute(idAttribute).Value) == id);

            return xdoc.Descendants(baseElement).Where(x => ids.Contains(int.Parse(x.Attribute(idAttribute).Value)));
        }
    }
}
